import React from "react";
import './Dog.css'
const Dog = ({name, age, src,facts})=>{

    return(
        <div class="Dog">
            <img src={src} alt={name} />
            <div class="DogInfo">
                {name}<br></br>
                Age: {age} Years Old
                <div class="facts">
                    {facts}
                </div>
            </div>


        </div>
    )

}

export default Dog;
